[parser] Update import expression estree output

Summary:
Updates our estree output to match the updated spec: https://github.com/estree/estree/blob/master/es2020.md#importexpression
```
interface ImportExpression <: Expression {
  type: "ImportExpression";
  source: Expression;
}
```

Babel has been outputting it this way since version 7.7.7: https://github.com/babel/babel/blob/master/CHANGELOG.md#v777-2019-12-19 - https://github.com/babel/babel/pull/10828

